(25, 'Page Layout', 'Layout Pagina', 'elementor', 2),
(26, 'Default Page Template from your theme', 'Template di pagina predefinito dal tema', 'elementor', 2),
(27, 'No header, no footer, just Elementor', 'Nessun header, nessun footer, solo Elementor', 'elementor', 2),
(28, 'This template includes the header, full-width content and footer', 'Questo template include l\'header, il contenuto a larghezza intera ed il footer', 'elementor', 2),
(29, 'Hide Title', 'Nascondi il titolo', 'elementor', 2),
(30, 'Not working? You can set a different selector for the title in the <a href=\"%s\" target=\"_blank\">Settings page</a>.', 'Non funziona? Puoi inserire un selettore differente per il titolo in <a href=\"%s\" target=\"_blank\">Impostazioni pagina</a>..', 'elementor', 2),
(31, 'Featured Image', 'Immagine in evidenza', 'elementor', 2),
