(34, 'Custom CSS', 'CSS personalizzato', 'elementor', 2),
(35, 'Custom CSS lets you add CSS code to any widget, and see it render live right in the editor.', 'Il CSS personalizzato ti permette di aggiungere del codice CSS a ciascun widget e vedere le modifiche direttamente nell\'editor.', 'elementor', 2),
(36, 'Meet Our Custom CSS', 'Guarda il nostro CSS personalizzato', 'elementor', 2),
