(43, 'UI Theme', 'UI Tema', 'elementor', 2),
(44, 'Set light or dark mode, or use Auto Detect to sync it with your OS setting.', 'Impostare la modalità luce o buio, oppure utilizzare Auto Detect per sincronizzarla con l\'impostazione del sistema operativo.', 'elementor', 2),
(45, 'Auto Detect', '', 'elementor', 0),
