(48, 'Editing Handles', 'Maniglie di Modifica', 'elementor', 2),
(49, 'Show editing handles when hovering over the element edit button.', 'Mostra maniglie di modifica quando si passa il mouse sopra il pulsante di modifica dell\'elemento.', 'elementor', 2),
(50, 'Enable Lightbox In Editor', 'Abilita Lightbox In Editor', 'elementor', 2),
(51, 'Default', 'Predefinito', 'default', 2),
